import { BrowserRouter as Router, Routes, Route, Navigate } from "react-router-dom";
import { lazy, Suspense } from "react";
import { AuthProvider, useAuth } from "./context/AuthContext";
import Layout from "./components/Layout";

// Lazy load pages for performance
const Landing = lazy(() => import("./pages/index"));
const Register = lazy(() => import("./pages/register"));
const Login = lazy(() => import("./pages/login"));
const Dashboard = lazy(() => import("./pages/dashboard"));
const KYCStep1 = lazy(() => import("./pages/kyc-step1"));
const KYCStep2 = lazy(() => import("./pages/kyc-step2"));
const KYCStep3 = lazy(() => import("./pages/kyc-step3"));
const KYCStep4 = lazy(() => import("./pages/kyc-step4"));
const KYCStep5 = lazy(() => import("./pages/kyc-step5"));
const Result = lazy(() => import("./pages/result"));

// Protected Route Component
function ProtectedRoute({ children }) {
  const { user } = useAuth();
  if (!user) return <Navigate to="/login" />;
  return children;
}

function App() {
  return (
    <AuthProvider>
      <Router>
        <Suspense fallback={<div className="text-center mt-20">Loading...</div>}>
          <Routes>
            <Route path="/" element={<Layout><Landing /></Layout>} />
            <Route path="/register" element={<Layout><Register /></Layout>} />
            <Route path="/login" element={<Layout><Login /></Layout>} />

            {/* Protected Dashboard & KYC Steps */}
            <Route
              path="/dashboard"
              element={
                <ProtectedRoute>
                  <Layout><Dashboard /></Layout>
                </ProtectedRoute>
              }
            />
            <Route
              path="/kyc-step1"
              element={
                <ProtectedRoute>
                  <Layout><KYCStep1 /></Layout>
                </ProtectedRoute>
              }
            />
            <Route
              path="/kyc-step2"
              element={
                <ProtectedRoute>
                  <Layout><KYCStep2 /></Layout>
                </ProtectedRoute>
              }
            />
            <Route
              path="/kyc-step3"
              element={
                <ProtectedRoute>
                  <Layout><KYCStep3 /></Layout>
                </ProtectedRoute>
              }
            />
            <Route
              path="/kyc-step4"
              element={
                <ProtectedRoute>
                  <Layout><KYCStep4 /></Layout>
                </ProtectedRoute>
              }
            />
            <Route
              path="/kyc-step5"
              element={
                <ProtectedRoute>
                  <Layout><KYCStep5 /></Layout>
                </ProtectedRoute>
              }
            />
            <Route
              path="/result"
              element={
                <ProtectedRoute>
                  <Layout><Result /></Layout>
                </ProtectedRoute>
              }
            />
          </Routes>
        </Suspense>
      </Router>
    </AuthProvider>
  );
}

export default App;
